function assignKeyName(event) {
    keyName = event.key.toUpperCase();
    if (keysArray.includes(keyName) && play) {
        console.log(keyName);
        addLetter(keyName);
    }
}

function assignKeyNameButton(buttonText) {
    if (buttonText === "DELETE") {
        buttonText = "BACKSPACE"
    }
    keyName = buttonText.toUpperCase();
    if (keysArray.includes(keyName) && play) {
        console.log(keyName);
        addLetter(keyName);
    }
}

function addLetter(keyName) {
    currentArr = currentGuess[guesses - 1];
    if (keyName == "ENTER") {
        if (currentArr[currentArr.length-1].textContent != "") {
            checkValidGuess();
        }
    }
    else if (keyName == "BACKSPACE") {
        for (i = currentArr.length - 1; i >= 0; i--) {
            if (currentArr[i].textContent != "") {
                currentArr[i].textContent = "";
                break;
            }
        }
    } else {
        for (let i = 0; i < currentArr.length; i++) {
            if (currentArr[i].textContent == "") {
                currentArr[i].textContent = keyName;
                break;
            }
        }
    }
}

function checkValidGuess() {
   playerGuess = "";
   for (i = 0; i < currentArr.length; i++) {
       playerGuess = playerGuess + currentArr[i].textContent;
       playerGuess = playerGuess.toLowerCase();
   }
   if (validWords.includes(playerGuess)) {
       isWinner();
   }
}



function isWinner() {
    correct = 0;
    for (let i = 0; i < currentArr.length; i++) {
        letter = currentArr[i].textContent;
        if (letter == answer[i]) {
            currentArr[i].style.backgroundColor = 'green';
            correct++;
        } else if (answer.includes(letter)) {
            currentArr[i].style.backgroundColor = 'yellow';
        } else {
            currentArr[i].style.backgroundColor = 'dimgray';
        }
        currentArr[i].style.color = 'black';
    }
    if (correct == answer.length) {
        play = false;
        modal.classList.add("open");
        let x = document.getElementById("winningstate");
        x.style.color = "#74b72e"
    } else { 
        guesses++;
        if (guesses == 7) {
            play = false;
            modal.classList.add("open");
            let x = document.getElementById("winningstate");
            x.textContent = "You lose, the word was " + answer + ", click on the link to learn more";
            x.style.fontSize = "35px";
            x.style.color = "#c61a09"
        }
    }
}


